import React from 'react';
import { Route, useNavigate } from 'react-router-dom';

const PrivateRoute = ({ component: Component, ...rest }) => {
    const navigate = useNavigate();
    return (
        <Route
            {...rest}
            render={props =>
                sessionStorage.getItem('token') ? (
                    <Component {...props} />
                ) : (
                    navigate('/login')
                )
            }
        />
    );
};

export default PrivateRoute;
